// ScrollSpyComponent.js
import React from 'react';
import ScrollSpy from "react-ui-scrollspy";
import Nav from 'react-bootstrap/Nav';
import 'bootstrap/dist/css/bootstrap.min.css';
import './App.css';

const ScrollSpy1 = () => {
  return (     
      <Nav className='pt-3 ' >
        <ScrollSpy
          items={['section1', 'section2', 'section3', 'section4', 'section5']}
          currentClassName="active" 
        >
          <Nav.Item >
             <Nav.Link data-to-scrollspy-id="home"><h4>Home</h4></Nav.Link>
         </Nav.Item>
         <Nav.Item >
              <Nav.Link data-to-scrollspy-id="about Us"><h4>About Us</h4></Nav.Link>
         </Nav.Item>
         <Nav.Item >
             <Nav.Link data-to-scrollspy-id="service"><h4>Services</h4></Nav.Link>
         </Nav.Item>
         <Nav.Item>
             <Nav.Link data-to-scrollspy-id="manage"> <h4>managment</h4></Nav.Link>
         </Nav.Item>
         <Nav.Item>
             <Nav.Link data-to-scrollspy-id="contact"> <h4>Contact Us</h4></Nav.Link>
         </Nav.Item>
        </ScrollSpy>
      </Nav>
  );
};

export default ScrollSpy1;
